To give you some background on the KDL format. Here is a small example: foo 1 "three" key="val" { bar (role)baz 1 2
} Here is what are annotations for all the datum as described by the [specification] and this guide: foo 1 "three" key="val" { ╮
─┬─ ┬ ───┬─── ────┬──── │ │ │ │ ╰───── property (can be multiple) │ │ │ │ │ │ ╰────┴────────────── arguments │ │ │ ╰── node name ├─ node "foo", with │ "bar" and "baz" bar │ being children (role)baz 1 2 │ ──┬─ │ ╰────── type name for node named "baz" │
} ╯ (note, the order of properties doesn't matter as well as the order of properties with respect to arguments, so I've moved arguments to have less intersections for the arrows)

