2.body:
Most common usage of this library is using derive and [parse] function: use kfl::Decode; #[derive(Decode)]
struct Config { #[kfl(children)] routes: Vec<Route>, #[kfl(children)] plugins: Vec<Plugin>,
} #[derive(Decode)]
struct Route { #[kfl(argument)] path: String, #[kfl(children)] subroutes: Vec<Route>,
} #[derive(Decode)]
struct Plugin { #[kfl(argument)] name: String, #[kfl(property)] url: String,
} # fn main() -> miette::Result<()> {
let config = kfl::decode_children::<Config>("example.kdl", r#" route "/api" { route "/api/v1" } plugin "http" url="https://example.org/http"
"#)?;
# Ok(())
# } This parses into a vector of nodes as enums Config, but you also use some node as a root of the document if there is no properties and arguments declared: #[derive(Decode)]
struct Document { #[kfl(child, unwrap(argument))] version: Option<String>, #[kfl(children)] routes: Vec<Route>, #[kfl(children)] plugins: Vec<Plugin>,
} let config = kfl::decode_children::<Document>("example.kdl", r#" version "2.0" route "/api" { route "/api/v1" } plugin "http" url="https://example.org/http"
"#)?; See description of Decode and DecodeScalar for the full reference on allowed attributes and parse modes.

